import React from 'react';
// import PropTypes from 'prop-types';
import styled from 'styled-components';

const HomeStyled = styled.div`
`;

const Home = ({
  postList
}) => {

  return (
    <HomeStyled>
      {postList[0].html}
    </HomeStyled>
  );
};

Home.propTypes = {
  postList: PropTypes.array.isRequired,
};

export default Home;
